import React from "react";

class EstadoFavo extends React.Component {
  render() {
    const { value, form } = this.props
    return (
      <div>
        <fieldset>
      <label>Estado Favorito? </label>
      <textarea name="estadoFav" value={value} onChange={form} />
      </fieldset>
      </div>
    )
  }
}

export default estadoFavo
